import React from "react";
import "../../components/styles/LoginPage.css";
import {
  Container,
  Row,
  Col,
  Form,
  Button,
} from "react-bootstrap";

export default function LoginPage() {
  return (
    <React.Fragment>
      <Container>
        
        <img  className="imglogin"
              src={require("../../images/foodeliv.png")}
              alt="FoodDeliv"
            ></img>
        
        <Row className="mt-0 formlogin">
          <Col
            lg={5}
            md={6}
            sm={12}
            className="p-5 m-auto shadow-sm rounded-lg"
          >
            <Form>
              <Form.Group controlId="formBasicEmail">
                <Form.Label>Address mail</Form.Label>
                <Form.Control type="email" placeholder="saisissez votre mail" />
              </Form.Group>

              <Form.Group controlId="formBasicPassword">
                <Form.Label>Mot de passe</Form.Label>
                <Form.Control type="password" placeholder="mot de passe" />
              </Form.Group>

              <Button variant="success btn-block m-2 col-4" type="submit">
                Login
              </Button>
            </Form>
          </Col>
        </Row>
      </Container>
    </React.Fragment>
  );
}
